import React, { useReducer, useRef, useEffect } from 'react';
import './../styles/reset.css';
import './../styles/our-product.css';
import axios from 'axios';

const initialState = {
  newProducts: [],
  onsale: [],
  featureProducts: [],
  loading: true,
  error: '',
  selectedCategory: 'new-products'
};

const reducer = (state, action) => {
  switch (action.type) {
    case 'set-new-products':
      return {
        ...state,
        newProducts: action.payloads,
        loading: false,
        error: ''
      };
    case 'set-onsale':
      return {
        ...state,
        onsale: action.payloads,
        loading: false,
        error: ''
      };
    case 'set-feature-products':
      return {
        ...state,
        featureProducts: action.payloads,
        loading: false,
        error: ''
      };
    case 'select-category':
      return {
        ...state,
        selectedCategory: action.payload
      };
    case 'FETCH_ERROR':
      return {
        ...state,
        loading: false,
        error: 'Something went wrong!'
      };
    default:
      return state;
  }
};

const OurProduct = () => {
  const [state, dispatch] = useReducer(reducer, initialState);
  const {
    newProducts,
    onsale,
    featureProducts,
    selectedCategory
  } = state;
  const cardListRef = useRef();

  const getDataByCategory = (category) => {
    dispatch({ type: 'select-category', payload: category });
  };

  const getImage = (image) => {
    // Import your images at the top of your component file.
    const source = require(`../img/${image}`);
    return source.default;
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const newProductsResponse = await axios.get('/api/new-products');
        dispatch({ type: 'set-new-products', payloads: newProductsResponse.data });

        const onsaleResponse = await axios.get('/api/onsale');
        dispatch({ type: 'set-onsale', payloads: onsaleResponse.data });

        const featureProductsResponse = await axios.get('/api/feature-products');
        dispatch({ type: 'set-feature-products', payloads: featureProductsResponse.data });
      } catch (error) {
        dispatch({ type: 'FETCH_ERROR' });
      }
    };

    fetchData();
  }, []);

  return (
    <section className="our-product">
      <div className="categories">
        <h4 className={selectedCategory === 'new-products' ? 'selected' : ''} onClick={() => getDataByCategory('new-products')}>
          New Products
        </h4>
        <h4 className={selectedCategory === 'onsale' ? 'selected' : ''} onClick={() => getDataByCategory('onsale')}>
          Onsale
        </h4>
        <h4 className={selectedCategory === 'feature-products' ? 'selected' : ''} onClick={() => getDataByCategory('feature-products')}>
          Feature Products
        </h4>
      </div>
      <div className="card-list" ref={cardListRef}>
        {selectedCategory === 'new-products' && newProducts.map((product) => (
          <div className="card" key={product.id}>
            <figure className="card-image" style={{ background: `url(${getImage(product.image)}) center / 70% no-repeat #eee` }}></figure>
            <div className="card-info">
              <h3>{product.title}</h3>
              <p className="price">Rp {product.price}</p>
            </div>
          </div>
        ))}
        {selectedCategory === 'onsale' && onsale.map((product) => (
          <div className="card" key={product.id}>
            <figure className="card-image" style={{ background: `url(${getImage(product.image)}) center / 70% no-repeat #eee` }}></figure>
            <div className="card-info">
              <h3>{product.title}</h3>
              <p className="price">Rp {product.price}</p>
            </div>
          </div>
        ))}
        {selectedCategory === 'feature-products' && featureProducts.map((product) => (
          <div className="card" key={product.id}>
            <figure className="card-image" style={{ background: `url(${getImage(product.image)}) center / 70% no-repeat #eee` }}></figure>
            <div className="card-info">
              <h3>{product.title}</h3>
              <p className="price">Rp {product.price}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default OurProduct;
